
#STEP D - Create a physical relational database
DROP database if exists audiobook;
CREATE DATABASE IF NOT EXISTS audiobook ;
USE audiobook ;



DROP TABLE IF EXISTS `location` ;
CREATE TABLE IF NOT EXISTS `location` (
  `location_id` INT NOT NULL,
  `street` VARCHAR(45) NULL,
  `city` VARCHAR(45) NOT NULL,
  `postal_code` VARCHAR(45) NULL,
  `country` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`location_id`));

DROP TABLE IF EXISTS `client` ;

CREATE TABLE IF NOT EXISTS `client` (
  `client_id` VARCHAR(10) NOT NULL,
  `first_name` VARCHAR(25) NOT NULL,
  `last_name` VARCHAR(25) NOT NULL,
  `email` VARCHAR(50) NOT NULL,
  `phone_number` VARCHAR(20) NULL,
  `birth_date` DATE NULL,
  `location_id` INT NOT NULL,
  PRIMARY KEY (`client_id`),
  INDEX `fk_CLIENT_LOCATION1_idx` (`location_id` ASC) VISIBLE,
  CONSTRAINT `fk_CLIENT_LOCATION1`
    FOREIGN KEY (`location_id`)
    REFERENCES `audiobook`.`LOCATION` (`location_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE);



DROP TABLE IF EXISTS `voice` ;

CREATE TABLE IF NOT EXISTS `voice` (
  `voice_id` INT NOT NULL,
  `first_name` VARCHAR(25) NOT NULL,
  `last_name` VARCHAR(25) NOT NULL,
  `nationality` VARCHAR(15) NOT NULL,
  PRIMARY KEY (`voice_id`));



DROP TABLE IF EXISTS `invoice` ;

CREATE TABLE IF NOT EXISTS `invoice` (
  `invoice_id` INT NOT NULL,
  `issued_date` DATE NOT NULL,
  `client_id` VARCHAR(10) NOT NULL,
  `books_bought` FLOAT(2) DEFAULT '0',
  PRIMARY KEY (`invoice_id`),
  INDEX `fk_INVOICE_CLIENT1_idx` (`client_id` ASC) VISIBLE,
  CONSTRAINT `fk_INVOICE_CLIENT1`
    FOREIGN KEY (`client_id`)
    REFERENCES `audiobook`.`CLIENT` (`client_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE);



DROP TABLE IF EXISTS `discount` ;

CREATE TABLE IF NOT EXISTS `discount` (
  `discount_id` INT ,
  `discount_percentage` FLOAT(4) NOT NULL,
   PRIMARY KEY (`discount_id`));


DROP TABLE IF EXISTS `author` ;

CREATE TABLE IF NOT EXISTS `author` (
  `author_id` INT NOT NULL,
  `first_name` VARCHAR(45) NOT NULL,
  `last_name` VARCHAR(45) NOT NULL,
  `nationality` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`author_id`));

-- -----------------------------------------------------
-- Table `audiobook`.`BOOK`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `book` ;

CREATE TABLE IF NOT EXISTS `book` (
  `book_id` INT NOT NULL,
  `language` VARCHAR(20) NOT NULL,
  `title` VARCHAR(200) NOT NULL,
  `price` FLOAT NOT NULL,
  `published_year` YEAR NULL,
  `audio_duration` FLOAT(6) NULL,
  `voice_id` INT NOT NULL,
  `discount_id` INT NOT NULL,
  `author_id` INT NOT NULL,
  PRIMARY KEY (`book_id`),
  INDEX `fk_BOOK_VOICE1_idx` (`voice_id` ASC) VISIBLE,
  INDEX `fk_BOOK_DISCOUNT1_idx` (`discount_id` ASC) VISIBLE,
  INDEX `fk_BOOK_AUTHOR1_idx` (`author_id` ASC) VISIBLE,
  CONSTRAINT `fk_BOOK_VOICE1`
    FOREIGN KEY (`voice_id`)
    REFERENCES `audiobook`.`VOICE` (`voice_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE,
  CONSTRAINT `fk_BOOK_DISCOUNT1`
    FOREIGN KEY (`discount_id`)
    REFERENCES `audiobook`.`DISCOUNT` (`discount_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE,
  CONSTRAINT `fk_BOOK_AUTHOR1`
    FOREIGN KEY (`author_id`)
    REFERENCES `audiobook`.`AUTHOR` (`author_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE);



DROP TABLE IF EXISTS `review` ;

CREATE TABLE IF NOT EXISTS `review` (
  `review_id` INT NOT NULL,
  `date` DATE NOT NULL,
  `rating` FLOAT(4) NOT NULL,
  `comment` TEXT(200) NULL,
  `client_id` VARCHAR(10) NOT NULL,
  `book_id` INT NOT NULL,
  PRIMARY KEY (`review_id`),
  INDEX `fk_REVIEW_CLIENT1_idx` (`client_id` ASC) VISIBLE,
  INDEX `fk_REVIEW_BOOK1_idx` (`book_id` ASC) VISIBLE,
  CONSTRAINT `fk_REVIEW_CLIENT1`
    FOREIGN KEY (`client_id`)
    REFERENCES `audiobook`.`CLIENT` (`client_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE,
  CONSTRAINT `fk_REVIEW_BOOK1`
    FOREIGN KEY (`book_id`)
    REFERENCES `audiobook`.`BOOK` (`book_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE);


DROP TABLE IF EXISTS `book_order` ;

CREATE TABLE IF NOT EXISTS `book_order` (
  `date` DATE NOT NULL,
  `invoice_id` INT NOT NULL,
  `book_id` INT NOT NULL,
  `book_price` INT DEFAULT 0,
  INDEX `fk_BOOK_ORDER_INVOICE1_idx` (`invoice_id` ASC) VISIBLE,
  INDEX `fk_BOOK_ORDER_BOOK1_idx` (`book_id` ASC) VISIBLE,
  CONSTRAINT `fk_BOOK_ORDER_INVOICE1`
    FOREIGN KEY (`invoice_id`)
    REFERENCES `audiobook`.`INVOICE` (`invoice_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE,
  CONSTRAINT `fk_BOOK_ORDER_BOOK1`
    FOREIGN KEY (`book_id`)
    REFERENCES `audiobook`.`BOOK` (`book_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE);


DROP TABLE IF EXISTS `category` ;

CREATE TABLE IF NOT EXISTS `category` (
  `category_id` INT NOT NULL,
  `category` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`category_id`));


DROP TABLE IF EXISTS `book_category` ;

CREATE TABLE IF NOT EXISTS `book_category` (
  `book_id` INT NOT NULL,
  `category_id` INT NOT NULL, 
  INDEX `fk_BOOK_has_CATEGORY_CATEGORY1_idx` (`category_id` ASC) VISIBLE,
  INDEX `fk_BOOK_has_CATEGORY_BOOK1_idx` (`book_id` ASC) VISIBLE,
  CONSTRAINT `fk_BOOK_has_CATEGORY_BOOK1`
    FOREIGN KEY (`book_id`)
    REFERENCES `audiobook`.`BOOK` (`book_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE,
  CONSTRAINT `fk_BOOK_has_CATEGORY_CATEGORY1`
    FOREIGN KEY (`category_id`)
    REFERENCES `audiobook`.`CATEGORY` (`category_id`)
    ON DELETE NO ACTION
    ON UPDATE CASCADE);

#STEP C- Create two triggers
#(1) one for updates 
#updates the number of books a client bought each time an order is made and the total value spent in books
#drop trigger if exists updatePurchases;
drop trigger if exists updatePurchases;
delimiter $$
create trigger updatePurchases
after insert on book_order 
for each row 
begin
update invoice set books_bought = ( books_bought +1 ) where invoice_id = new.invoice_id;

end $$
delimiter ;

# (2) a trigger that inserts a row in a “log” table when  the price of a book is updated.
#drop trigger if exists logTable;
drop table if exists log;
CREATE TABLE log (
LOG_ID INTEGER UNSIGNED AUTO_INCREMENT PRIMARY KEY,
DT DATETIME NOT NULL,
USR VARCHAR(63),
OLD_PRICE FLOAT ,
NEW_PRICE FLOAT ,
BOOK_ID INT 
);
DELIMITER $$
CREATE TRIGGER logTable
AFTER UPDATE
ON book
FOR EACH ROW
BEGIN
INSERT log (DT,USR,OLD_PRICE,NEW_PRICE, BOOK_ID)
VALUES (NOW(),USER(),OLD.price,NEW.price, NEW.book_id);
END $$
DELIMITER ;
