#STEP G - invoice views

#drop view if exists HeadTotals;
create view HeadTotals as
select i.invoice_id as 'Invoice Number',
concat(c.first_name, ' ', c.last_name) AS 'Client Name',
loc.street as 'Street Address', concat(loc.city,',', loc.country) as 'City, Country',
loc.postal_code as 'Zip Code', c.phone_number as 'Phone Number', c.email as 'email',
concat(sum(b.price*(d.discount_percentage/100)),'€') as Discount,
concat(round(sum(b.price-(b.price*(d.discount_percentage/100))),2),'€')  as Subtotal,
concat(round(sum(b.price-(b.price*(d.discount_percentage/100))) - sum(b.price*(d.discount_percentage/100)),2),'€')  as 'Invoice Total'
from invoice i
join client c on c.client_id = i.client_id
join location loc on loc.location_id = c.location_id 
join book_order bo on bo.invoice_id = i.invoice_id
join book b on b.book_id = bo.book_id
join discount d on d.discount_id = b.discount_id
where i.invoice_id = 1 ;
#test 
-- select * from HeadTotals;

#drop view if exists Details;
create view Details as 

select b.title as 'Description', concat((b.price-(b.price*(d.discount_percentage/100))),'€') as 'Unit Cost'
from book b
join discount d on b.discount_id  = d.discount_id
join book_order bo on b.book_id=bo.book_id
join invoice i on bo.invoice_id=i.invoice_id
where i.invoice_id=1
group by b.book_id; 
#test 
-- select * from Details;




